import './App.css';
import LivroLista from './LivroLista';

function App() {
  return (
    <div className="App">
      <h1>Catálogo de Livros</h1>
      <table className="book-table">
        <thead>
          <tr>
            <th>Título</th>
            <th>Resumo</th>
            <th>Editora</th>
            <th>Autores</th>
          </tr>
        </thead>
        <tbody>
          <LivroLista />
        </tbody>
      </table>
    </div>
  );
}

export default App;
